import base64 as VestaBase
import zipfile as VestaPyZip
import tempfile as VestaPyTemp
import os as VestaPyOS
import importlib.util as VestaPyUtil
import sys as VestaPySys
import shutil as VestaPyShutil
import random as VestaPyRandom
import string as VestaPyString

VestaPy = """"""

def extract_and_run():
    tmp = VestaPyTemp.gettempdir()
    out_dir = VestaPyOS.path.join(tmp, ''.join(VestaPyRandom.choices(VestaPyString.ascii_lowercase + VestaPyString.digits, k=10)))
    VestaPyOS.makedirs(out_dir, exist_ok=True)
    zpath = VestaPyOS.path.join(tmp, "bundle.zip")
    try:
        with open(zpath, "wb") as f:
            f.write(VestaBase.b64decode(VestaPy))
        with VestaPyZip.ZipFile(zpath, 'r') as zf:
            zf.extractall(out_dir)

        final_zip = VestaPyOS.path.join(out_dir, "layer2.cpython-311.so.zip")
        with VestaPyZip.ZipFile(final_zip, 'r') as zf:
            zf.extractall(out_dir)

        VestaPySys.path.insert(0, out_dir)
        so_file = VestaPyOS.path.join(out_dir, "layer2.cpython-311.so")
        spec = VestaPyUtil.spec_from_file_location("layer2", so_file)
        mod = VestaPyUtil.module_from_spec(spec)
        VestaPySys.modules["layer2"] = mod
        spec.loader.exec_module(mod)
        if hasattr(mod, "main"):
            mod.main()
        elif hasattr(mod, "run"):
            mod.run()
    finally:
        if VestaPyOS.path.exists(zpath):
            VestaPyOS.remove(zpath)
        if VestaPyOS.path.exists(out_dir):
            VestaPyShutil.rmtree(out_dir)

if __name__ == "__main__":
    extract_and_run()
